---
---

{% include header.html %}
<div class="naeAnalytics__wrapper">
    <div style="background:blue" class="naeAnalytics__sidebar"></div>

    <div class="naeAnalytics__content">

        <div class="content__wrapper">

            <div style="border-bottom:2px solid black" class="d-flex space-between">
                <div class="col col-4">
                    <div class="chart chart__sessionsYear">
                        <h2>Sessions This Week vs. Last Week</h2>
                        <div class="iframe__container" style="position:relative; width: 100%; height:150px">
                            <iframe style="position:absolute;top:0;left:0; width:100%; height: 100%;" seamless
                                frameborder="0" scrolling="no"
                                src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=728987849&amp;format=interactive"></iframe>
                        </div>
                        <div class="iframe__container" style="position:relative; width: 100%; height:400px">
                            <iframe style="position:absolute;top:0;left:0; width:100%; height: 100%;" seamless
                                frameborder="0" scrolling="no"
                                src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=1140472646&amp;format=interactive"></iframe>
                        </div>
                    </div>
                </div>
                <div class="col col-6">
                    <div class="chart chart__topPages--week">
                        <h2>Top Pages This Week</h2>
                        <iframe width="900" height="161" seamless frameborder="0" scrolling="no"
                            src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=1578570082&amp;format=interactive"></iframe>
                    </div>
                </div>
            </div>

            <div style="padding:1rem 0; border-bottom:2px solid black" class="d-flex space-between">
                <div style="width:50%" class="chart chart--no-border chart__sources--week">
                    <h2>Traffic Sources This Week</h2>
                    <iframe width="600" height="298" seamless frameborder="0" scrolling="no"
                        src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=224911424&amp;format=interactive"></iframe>
                </div>

                <div style="width:45%" class="chart chart--no-border">
                    <h2>Sessions by Device Category (This Week)</h2>
                    <iframe width="483" height="298" seamless frameborder="0" scrolling="no"
                        src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=629994088&amp;format=interactive"></iframe>
                </div>
            </div>

            <div style="padding: 1rem 0; border-bottom:2px solid black" class="d-flex space-between">
                <div class="col col-6">
                    <div class="chart" style="width:100%">
                        <h2>Site Searches This Week</h2>
                        <iframe width="900" height="293" seamless frameborder="0" scrolling="no"
                            src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=915974585&amp;format=interactive"></iframe>
                    </div>
                </div>
                <div class="col col-4">
                    <div class="chart" style="width:100%">
                        <h2>Top Cities This Week</h2>
                        <iframe width="500" height="350" seamless frameborder="0" scrolling="no"
                            src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=1043484282&amp;format=interactive"></iframe>
                    </div>
                </div>
            </div>



            <div style="border-bottom:2px solid black" class="d-flex space-between">
                <div class="chart chart__sessionsYear">
                    <h2>Sessions by Week of Year</h2>
                    <iframe id="chart__sessionsYear" width="1200" height="400" seamless frameborder="0" scrolling="yes"
                        src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=1530731750&amp;format=interactive"></iframe>
                </div>


            </div>


            <div style="border-bottom:2px solid black" class="d-flex space-between">
                <div class="chart col-6 chart__topPages--year">
                    <h2>Top Pages This Year</h2>
                    <iframe width="800" height="161" seamless frameborder="0" scrolling="no"
                        src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=913466173&amp;format=interactive"></iframe>

                    <h2>Top Searches This Year</h2>
                    <iframe width="600" height="371" seamless frameborder="0" scrolling="no"
                        src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=1749641450&amp;format=interactive"></iframe>
                </div>
                <div class="col-4 chart chart__topPages--year">
                    <h2>Top Sources This Year</h2>
                    <iframe width="619" height="371" seamless frameborder="0" scrolling="no"
                        src="https://docs.google.com/spreadsheets/d/e/2PACX-1vRXxaXG3lAgi7_EJN0YetZbsxypfj6WNzvGHu7pY4bNiVFBUtaCFYEKTtKheIAFMdDoUr99JqSyL77S/pubchart?oid=832317302&amp;format=interactive"></iframe>
                </div>
            </div>




        </div>
    </div>
</div>

</body>

</html>
